import React, { useState } from "react"
import { useTranslation, withTranslation } from "react-i18next"
import PropTypes from 'prop-types';
import Breadcrumbs from "../../../../components/Common/Breadcrumb"
import {
    Row,
    Col,
    Button,
    Label,
    Input,
    Modal,
    Card,
    CardBody,
    CardFooter,
    InputGroup,
    CardHeader,
    Table,
} from "reactstrap"

import Switch from "react-switch";
import { AvForm, AvField, AvGroup } from "availity-reactstrap-validation"
import { BackendServices, CoreServices } from "../../../../services";
import { useLocation, useHistory } from "react-router-dom";
import * as url from "../../../../helpers/url_helper"
import HeaderSections from "../../../../components/Common/HeaderSections";
import moment from "moment";
import Currency from "../../../../helpers/currency";
import AspectosAmbientales from "./Secciones/AspectosAmbientales";
import { uniq_key } from "../../../../helpers/unq_key";
import AccountMovementsHistory from "../../../../components/Common/AccountMovementsHistory";
import RelacionesBancarias from "./Secciones/RelacionesBancarias";
import MoviemientosCuentas from "./Secciones/MoviemientosCuentas";
import InformacionGarante from "./Secciones/InformacionGarante";
import LoadingOverlay from "react-loading-overlay";
const estiloTotales = { backgroundColor: "lightgrey", color: "black" }
const Offsymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            No
        </div>
    );
};
const OnSymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            Si
        </div>
    );
};
const PrevicualizarIGR = (props) => {
    let modelo = {
        datosGenerales: {
            codigoTipoIdentificacion: null,
            numeroCliente: null,
            primerNombre: null,
            segundoNombre: null,
            primerApellido: null,
            segundoApellido: null,
            numeroIdentificacion: null,
            transactId: 0,
            economicGroup: {
                code: "",
                name: ""
            },
            economicActivity: {
                code: "",
                name: ""
            },
            subeconomicActivity: {
                code: "",
                name: ""
            },
            bank: {
                code: "",
                name: ""
            },
        },
        datosEmpresa: {
            transactId: "",
            referencePoint: "",
            residency: "",
            houseNumber: "",
            phoneNumber: "",
            mobileNumber: "",
            workNumber: "",
            email: "",
            exclusion: false,
            sustainable: false,
            apto: "",
            country: {
                code: "",
                name: ""
            },
            province: {
                code: "",
                name: ""
            },
            district: {
                code: "",
                name: ""
            },
            township: {
                code: "",
                name: ""
            },
            city: {
                code: "",
                name: ""
            },
            sector: {
                code: "",
                name: ""
            },
            subSector: {
                code: "",
                name: ""
            },
        },
        historiaEmpresa: {
            transactId: 0,
            description: " ",
            employeesNumber: 0,
            details: " "
        },
        dataAccionistas: {
            transactId: 0,
            informacionAccionistaDetails: " ",
            datosTablaAccionistas: null,
            observations: " ",
            description: " ",
        },
        dataGobiernoCorporativo: {
            transactId: 0,
            corporateIdentification: 0,
            name: " ",
            position: " ",
            birthDate: " ",
            age: " ",
            status: true,
            dataTableGobiernoCorporativo: null
        },
        dataRelevoGeneracional: {
            trasactId: 0,
            observations: " ",
            dataTableRelevo: null
        },
        dataFlujoOperativo: {
            transactId: 0,
            observations: " ",
            infoDate: null
        },
        dataEstructuraOrganizacional: {
            transactId: 0,
            description: null,
            date: ""
        },
